import styled from 'styled-components';

export const Container = styled.div``;

export const Player = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  padding: 20px;

  h1 {
    font-family: Roboto, sans-serif;
    color: #333;
  }

  div {
    padding: 5px;
    border: 1px solid #333;
  }
`;
